STYLES.TAB STYLES:

.tab {
    overflow: hidden;
    border: 1px solid #ccc;
    background-color: #f1f1f1;
    }

/* Style the buttons inside the tab */
.tab button {
    background-color: inherit;
    float: left;
    border: none;
    outline: none;
    cursor: pointer;
    padding: 14px 16px;
    transition: 0.3s;
    font-size: 17px;
    }

/* Change background color of buttons on hover */
.tab button:hover {
    background-color: #ddd;
    }

/* Create an active/current tablink class */
.tab button.active {
    background-color: #ccc;
    }

/* Style the tab content */
.tabcontent {
    padding: 6px 12px;
    border: 1px solid #ccc;
    border-top: none;
    }

/* Style the close button */
.topright {
    float: right;
    cursor: pointer;
    font-size: 28px;
    }

.topright:hover {color: red;}

STYLES.GRID STYLES:

.grid-container {
    display: inline-grid;
    grid-column-gap: 10px;
    grid-row-gap: 10px;
    padding: 10px;
    background-color: #e6e8f0;

    }

.grid-item {
    background-color: #f5f7ff;
    border: 0px solid rgba(0, 0, 0, 0.8);
    padding: 5px;
    font-size: 20px;
    text-align: center;
    justify-self: left;
    align-self: start;
    }

STYLES.FOLD STYLES:


.fold {
    background-color: #777;
    color: white;
    cursor: pointer;
    padding: 2px;
    margin: 0px;
    width: 100%;
    border: none;
    text-align: left;
    outline: none;
    font-size: 15px;
    }

.active, .fold:hover {
    background-color: #555;
    }

.fold:after {
    content: '\002B';
    color: white;
    font-weight: bold;
    float: left;
    margin-left: 5px;
    }

.active:after {
    content: "\2212";
    }

.foldcontent {
    padding: 0 18px;
    max-height: 0;
    overflow: hidden;
    transition: max-height 0.2s ease-out;
    background-color: #f1f1f1;
    }
